import React, { Component } from 'react'
import Layout from '../components/layout'
import Table from '../components/table/table'

export class Staff extends Component {
    
    render() {
        return (
            <div>
               <Layout>
                   <Table {...this.props}/>
               </Layout>
            </div>
        )
    }
}

export default Staff
